import 'bootstrap/dist/css/bootstrap.css';

const ProductListItem = ({item}) => {
    console.log(item)

    return (
        <div className="flex-item">
            <p>Category: <span><strong>{item.category}</strong></span></p>
            <img src={item.image}></img>
            <h6>${item.price}</h6>
            <h4>{item.name}</h4>
        </div>
    )

}

export default ProductListItem
